import React, { Component } from "react";
import CardColumns from "react-bootstrap/CardColumns";
import PostContainer from "./PostContainer";

class PostsContainer extends Component {
  state = {
    posts: [
      { id: 1, title: "Grass Cutting" },
      { id: 2, title: "Grave Digging" },
      { id: 3, title: "Fry Cook" },
      { id: 4, title: "Good Cop" },
      { id: 5, title: "Bad Cop" },
      { id: 6, title: "Interogee" },
    ],
  };

  render() {
    return (
      <div>
        <center>
          <h3> Popular Posts </h3>
          <CardColumns>
            {this.state.posts.map((post) => (
              <PostContainer key={post.id} title={post}></PostContainer>
            ))}
          </CardColumns>

          <CardColumns>
            <PostContainer />
            <PostContainer />
            <PostContainer />
            <PostContainer />
            <PostContainer />
            <PostContainer />
          </CardColumns>
        </center>
      </div>
    );
  }
}

export default PostsContainer;
